Like SetSelection, this lets you set up a notesNoteCollection to search for design elements of a particular type, but it adds the ability to specify additional criteria to further narrow the selection.

This can be either in the form of a formula, or &amp;quot;*&amp;quot; followed by a design element title.
@see DesignUtils.SetSelection()

